import '@fortawesome/fontawesome-free/css/all.css';
import '../components/Navbar.css';




const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleNavbar = () => {
    setIsOpen(!isOpen);
  };


    return (
        <nav className={'nav__blue'}>
